import React, { useEffect, useState } from "react";
import "./View.css";

function View({ content, selectedContent }) {
  return (
    <div className="View">
      <div className="View__item">
        {selectedContent.map((value) => {
          <li className="View__list" key={value.id}>
            <div className="username">{value.username}</div>
            <div className="title">{value.title}</div>
            <div className="title">{value.content}</div>
            <div className="createAt">{value.createdAt}</div>
          </li>;
        })}
      </div>
      <div className="View__btns">
        <button className="수정">수정</button>
        <button className="삭제">삭제</button>
      </div>
    </div>
  );
}

export default View;
